d = 31668017 * (userBalance / 1e16); // 10% APY per year for 0.01 ETH\\r\\n    uint interest = interestPerSecond * depositTime;\\r\\n\\r\\n    token.mint(msg.sender, interest);\\r\\n\\r\\n    msg.sender.transfer(userBalance);\\r\\n    \\r\\n    depositStart[msg.sender] = 0;\\r\\n    getEtherBalance[msg.sender] = 0;\\r\\n    isDeposited[msg.sender] = false;\\r\\n\\r\\n    emit Withdraw(msg.sender, userBalance, depositTime, interest);\\r\\n\\r\\n  }\\r\\n\\r\\n  function borrow() payable public {\\r\\n    //check if collateral is >= than 0.01 ETH\\r\\n    //check if user doesn\'t have active loan\\r\\n\\r\\n    //add msg.value to ether collateral\\r\\n\\r\\n    //calc tokens amount to mint, 50% of msg.value\\r\\n\\r\\n    //mint&send tokens to user\\r\\n\\r\\n    //activate borrower\'s loan status\\r\\n\\r\\n    //emit event\\r\\n  }\\r\\n\\r\\n  function payOff() public {\\r\\n    //check if loan is active\\r\\n    //transfer tokens from user back to the contract\\r\\n\\r\\n    //calc fee\\r\\n\\r\\n    //send user\'s collateral minus fee\\r\\n\\r\\n    //reset borrower\'s data\\r\\n\\r\\n    //emit event\\r\\n  }\\r\\n}","sourcePath":"/Users/nishant/BlockchainProjects/DeFi_Bank/src/contracts/dBank.sol","ast":{"absolutePath":"/Users/nishant/BlockchainProjects/DeFi_Bank/src/contracts/dBank.sol","exportedSymbols":{"Context":[342],"ERC20":[1041],"IERC20":[1119],"SafeMath":[538],"Token":[108],"dBank":[319]},"id":320,"license":"MIT","nodeType":"SourceUnit","nodes":[{"id":110,"literals":["solidity",">=","0.6",".0","<","0.8",".0"],"nodeType":"PragmaDirective","src":"33:31:2"},{"absolutePath":"/Users/nishant/BlockchainProjects/DeFi_Bank/src/contracts/Token.sol","file":"./Token.sol","id":111,"nodeType":"ImportDirective","scope":320,"sourceUnit":109,"src":"68:21:2","symbolAliases":[],"unitAlias":""},{"abstract":false,"baseContracts":[],"contractDependencies":[],"contractKind":"contract","fullyImplemented":true,"id":319,"linearizedBaseContracts":[319],"name":"dBank","nodeType":